import React, { useState } from 'react';
import { SignUpForm, LoginForm } from './Forms';

const App = () => {
  const [currentPage, setCurrentPage] = useState('home'); // 'home', 'login', 'signup', 'dashboard'

  const handleSignupFormSubmit = (e) => {
    e.preventDefault();
    // Handle sign up form submission logic
    console.log('Sign Up form submitted');
    setCurrentPage('roleSelection');
  };

  const handleLoginFormSubmit = (e) => {
    e.preventDefault();
    // Handle login form submission logic
    console.log('Login form submitted');
    setCurrentPage('dashboard');
  };

  const handleLoginClick = () => {
    // Handle login button click
    setCurrentPage('login');
  };

  const handleSignupClick = () => {
    // Handle sign up button click
    setCurrentPage('signup');
  };

  const handleRoleSelectionSubmit = () => {
    // Handle role selection form submission logic
    console.log('Role selection form submitted');
    setCurrentPage('personalInfo');
  };

  const handlePersonalInfoSubmit = () => {
    // Handle personal info form submission logic
    console.log('Personal info form submitted');
    setCurrentPage('inviteSection');
  };

  const handleInviteSubmit = () => {
    // Handle invite section form submission logic
    console.log('Invite section form submitted');
    setCurrentPage('dashboard');
  };

  return (
    <div>
      {/* Welcome Section */}
      {currentPage === 'home' && (
        <section id="section1">
          <header>Welcome</header>
          <p>Hello world for now!</p>
          <button onClick={handleLoginClick}>Login</button>
          <button onClick={handleSignupClick}>Sign Up</button>
        </section>
      )}

      {/* Login Form */}
      {currentPage === 'login' && (
        <LoginForm handleLoginFormSubmit={handleLoginFormSubmit} />
      )}

      {/* SignUp Form */}
      {currentPage === 'signup' && (
        <SignUpForm handleSignupFormSubmit={handleSignupFormSubmit} />
      )}

      {/* Role Selection Form */}
      {currentPage === 'roleSelection' && (
        <section id="sectionloginsignup" className="login-sign-up">
          <div id="role-selection" className="form-container">
            <h2>Are you...</h2>
            <p>If more than one role is applicable to you, select the most pertinent one and you'll be able to update your profile later with more roles!</p>
            <form onSubmit={handleRoleSelectionSubmit}>
              {/* Role selection options */}
              <button type="submit" className="role-button" data-role="pregnant">Pregnant</button>
              <button type="submit" className="role-button" data-role="professional">A Healthcare Provider or Healthcare Support Professional</button>
              {/* Add more role options as needed */}
            </form>
          </div>
        </section>
      )}

      {/* Personal Information Form */}
      {currentPage === 'personalInfo' && (
        <section id="sectionloginsignup" className="login-sign-up">
          <div id="personal-info" className="form-container">
            <h2>Personal Information</h2>
            <form onSubmit={handlePersonalInfoSubmit}>
              {/* Personal information fields */}
              {/* Include personal information fields here */}
              <button type="submit">Next</button>
            </form>
          </div>
        </section>
      )}

      {/* Invite Section */}
      {currentPage === 'inviteSection' && (
        <section id="sectioninvite">
          <div id="invite" className="form-container">
            <h2>Has someone sent you an invite code to join?</h2>
            <form onSubmit={handleInviteSubmit}>
              {/* Invite code entry */}
              <input type="text" placeholder="Enter invite code" required />
              <button type="submit">Submit</button>
            </form>
          </div>
        </section>
      )}

      {/* Dashboard */}
      {currentPage === 'dashboard' && (
        <section id="sectiondashboard">
          <div id="dashboard">
            <header>Dashboard</header>
            <p>Welcome to your dashboard!</p>
          </div>
        </section>
      )}
    </div>
  );
};

export default App;
